import numpy as np

################################################################################
"""
Coefficients for Heaviside and Bump functions with slepian_r as the _c_*

Bump / Step give the associated bump and step (integrated bump) functions
These give Chebyshev coefficients on [-1, 1], with the step function running
from epsilon --> 1-epsilon for some epsilon > 0 that depends on slepian_r,
with epsilon --> 0 as slepian_r --> infty

bump_c_* and step_c_* give the full coefficients for the function.
bump_c_even_* gives only the even coefficients (since this funciton is even!)
step_c_even_* is more complicated.  The step function is not odd, but:
  step - 0.5 is odd.  Letting f(x) = step(x)-0.5, step_c_even_* gives the
  even coefficients for the even function f(x)/x.

bump_c_even and step_c_even can be used to efficiently evaluate the bump
and step functions using the functions numba_chbevl_even & numba_step_eval,
contained in chebval.py.
"""

